import{_ as e}from"./plugin-vue_export-helper-DlAUqK2U.js";import{c as t,o as r,e as p}from"./app-wJXw8B29.js";const a={},o=p('<h3 id="第一周打卡总结" tabindex="-1"><a class="header-anchor" href="#第一周打卡总结"><span>第一周打卡总结</span></a></h3><p>当时要求的是任务是：</p><ul><li>回顾Java：什么是对象</li><li>搭建第一个 Spring Boot 项目</li><li>运行编程喵开源实战项目</li><li>完成星球专栏《面试官喜欢什么样的项目》主题编写</li></ul><p>完成情况：</p><ul><li>回顾Java：什么是对象✔️，笔记地址：<a href="https://blog.csdn.net/buzai_chenmo/article/details/124522731" target="_blank" rel="noopener noreferrer">https://blog.csdn.net/buzai_chenmo/article/details/124522731</a></li><li>搭建第一个 Spring Boot 项目✔️地址：<a href="https://t.zsxq.com/02rJeiYRj" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02rJeiYRj</a></li><li>运行编程喵开源实战项目✔️，笔记地址：<a href="https://blog.csdn.net/buzai_chenmo/article/details/124536275" target="_blank" rel="noopener noreferrer">https://blog.csdn.net/buzai_chenmo/article/details/124536275</a></li><li>编程喵整合 MySQL+Druid✔️笔记地址：<a href="https://t.zsxq.com/02IyrZFiq" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02IyrZFiq</a></li><li>编程喵整合 JPA✔️笔记地址：<a href="https://t.zsxq.com/02Mfqr7UB" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02Mfqr7UB</a></li><li>《Java 面试指南》面试官喜欢什么样的求职者✔️笔记地址：<a href="https://t.zsxq.com/6iuzn6I" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/6iuzn6I</a></li></ul><p>总的来说，自从开启星球后，工作和学习都更高效了。之前一个朋友给我说，“输出倒逼输入，最好的学习方式不是输入多少，而是输出了多少”，还是非常有道理的。</p><p>整个人也变得更加自律了，星主算是比较自律了，但这次有了球友们的督促后，发现真的不一样，因为肩上有一份责任，心里有一份热情，脚下有一份鼓励，所以干什么事情都更加卖力了。</p><p>另外，积分也出来了，恭喜前十名球友，你们都是最棒的。</p><p>第一名：沉默王二，作为我们的星主，遥遥领先其他球友也没什么值得骄傲的，哈哈。球友们，争取干掉他。</p><p>第二名：南风知我意，非常积极的球友</p><p>第三名：大三飞鸟</p><p>第四名：小豪</p><p>第五名：独孤孤独</p><p>第六名：炳源</p><p>第七名：melo</p><p>第八名： 疯狂地学习</p><p>第九名： 付雷彬</p><p>第十名： EE&amp;&amp;CS</p><p>没上榜的球友也要加油了，积极打卡，积极点赞，积极分享，既然来了，便只顾风雨兼程，和球友们一起，让时间过得更充实，让自己变得更秃，不，更强！</p><p>一年之后，你一定会感谢现在的自己，怀念曾经卷过的自己。</p><h3 id="第二周打卡总结" tabindex="-1"><a class="header-anchor" href="#第二周打卡总结"><span>第二周打卡总结</span></a></h3><ul><li>第07节：Spring Boot 整合 Redis 缓存✔️地址：<a href="https://t.zsxq.com/EYBiMBM" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/EYBiMBM</a></li><li>第06节：Spring Boot 中使用过滤器、拦截器、监听器✔️地址：<a href="https://t.zsxq.com/bE6ynMV" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/bE6ynMV</a></li><li>二哥的Java进阶之路（<a href="https://javabetter.cn/" target="_blank" rel="noopener noreferrer">https://javabetter.cn/</a>）图片压缩，在调查 CDN 日志的时候发现，两三点还有小伙伴在学习✔️地址：<a href="https://t.zsxq.com/jqrJyFQ" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/jqrJyFQ</a></li><li>第05节，Spring Boot如何开启事务支持✔️ 笔记地址：<a href="https://t.zsxq.com/jiMZ7QF" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/jiMZ7QF</a></li><li>第04节，Spring Boot 整合 Thymeleaf 模板引擎✔️笔记地址：<a href="https://t.zsxq.com/QVjU3BQ" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/QVjU3BQ</a></li><li>《Java 面试指南》面试官喜欢什么样的求职者✔️笔记地址：<a href="https://t.zsxq.com/6iuzn6I" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/6iuzn6I</a></li></ul><p>昨天晚上听池建强老师的播客，听到他说的一些话，非常有感慨。大多数普通人，只需要做好一件事就行了，那就是坚持，坚持一周没效果，就坚持一个月，一个月还没有，坚持一年，一年还没有，坚持十年。</p><p>当然了，前提条件是你在做一件有意义的事情。</p><p>也是，我是从 2014 年开始写作的，我没有写作天赋，我没有过硬的技术，没有太过耀眼的履历，学历也非常一般，绝大多数的球友都比我有优势。但我依然取得了很多很多程序员无法达到的成绩，为什么？</p><p>我想就是坚持吧。</p><p>仅 2020 年到 2022 年（五月份），我就在公众号上产出了 715 篇原创，这是什么概念，大家可以算一算。</p><p>为了保证自己学习的劲头，星球上周我产出了四条主题，不只是为了给球友们交付，也是为我自己交付。我是一个坚持主义者，我相信坚持的力量，只要大家敢在星球里持续打卡学习一周年，相信到时候你会来感激我的。</p><p>offer 拿到手软，自己的知识库也丰富起来了，逻辑很简单，就看行动了。</p><p>咦，上周的积分榜竟然消失了（以后要周日写总结），就还按照月榜来吧，恭喜前十名球友，你们都是最棒的。</p><p>第一名：沉默王二，上周排名低一，太强了我们星主。</p><p>第二名：南风知我意，上周排名第二，强</p><p>第三名：大三飞鸟，上周排名第三</p><p>第四名：小豪，上周排名第四</p><p>第五名：独孤孤独，上周排名第五</p><p>第六名：melo，上周排名第七（进步一名）</p><p>第七名：炳源，上周排名第六（掉了一名）</p><p>第八名： EE&amp;&amp;CS，上周排名第 10（冲上来了）</p><p>第九名： 疯狂地学习，上周排名第 8（下降一名）</p><p>第十名： 付雷彬，上周排名第 9（下降一名）</p><p>其他球友要加油了，毕竟这周要送价值 179 元的 on Java 8 实体书（上下两册，超级精美）。</p><p>不仅能学习，还能赚回球票，简直不要太爽！</p><h3 id="第三周打卡总结" tabindex="-1"><a class="header-anchor" href="#第三周打卡总结"><span>第三周打卡总结</span></a></h3><p>这周一共完成 6 节《编程喵🐱实战项目笔记》：</p><ul><li>第13节：Spring Boot 整合Quartz实现编程喵定时发布文章✔️地址：<a href="https://t.zsxq.com/02ZjUFayF" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02ZjUFayF</a></li><li>第 12 节：Spring Boot整合MyBatis-Plus，并通过AutoGenerator生成编程喵项目骨架代码✔️地址：<a href="https://t.zsxq.com/02RbqrRJA" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02RbqrRJA</a></li><li>第11节：Spring Boot整合SpringTask实现定时任务✔️地址：<a href="https://t.zsxq.com/02mUvvnuF" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02mUvvnuF</a></li><li>第 10 节：Spring Boot整合Knife4j，美化强化丑陋的Swagger✔️地址：<a href="https://t.zsxq.com/02qZbYNNj" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02qZbYNNj</a></li><li>第09节：Spring Boot 整合 Swagger-UI 实现在线API文档✔️ 笔记地址：<a href="https://t.zsxq.com/02vR3fAQF" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02vR3fAQF</a></li><li>第08节：Spring Boot整合Logback✔️笔记地址：<a href="https://t.zsxq.com/026q3BYB6" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/026q3BYB6</a></li></ul><p>6 个硬核分享：</p><ul><li>秋招准备：<a href="https://t.zsxq.com/02m6iyVbI" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02m6iyVbI</a></li><li>蚂蚁面经分享：<a href="https://t.zsxq.com/02aQJMJYz" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02aQJMJYz</a></li><li>罗马不是一天建成的：<a href="https://t.zsxq.com/02YN7IMfM" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02YN7IMfM</a></li><li>促学计划：<a href="https://t.zsxq.com/02fEqbmYV" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02fEqbmYV</a></li><li>后端开发四件套学习计划：<a href="https://t.zsxq.com/02aiieQJm" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02aiieQJm</a></li><li>offer 选择，腾讯云智还是网易：<a href="https://t.zsxq.com/02vJuByvR" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02vJuByvR</a></li></ul><p>上一周总结：<a href="https://t.zsxq.com/02FM7Aa6i" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02FM7Aa6i</a></p><p>送书三本《on Java8 中文版，上下两册》，价值 179 元。按照规则，周榜前三名：</p><p>第一名：沉默王二。</p><p>第二名：南风知我意</p><p>第三名：大三飞鸟</p><p>第四名：独孤孤独</p><p>第五名：小豪</p><p>第六名：柳</p><p>第七名：慎独</p><p>第八名：linesjia</p><p>第九名：张培根同学</p><p>第十名：炳源</p><p>对获奖的球友提个要求：</p><ul><li>1，收到书后在星球和 VIP 晒一下。</li><li>2，完善星球坦白从宽贴。</li><li>3，不要懈怠，持续打卡，做出表率。</li></ul><p>哈哈哈，没有别的要求了，就让我们一起共建“沉默王二特色主义的编程私密圈”吧，相信坚持的过程，相信一年后的你，一定会大有所获。</p><p>昨天晚上听池建强老师的播客，听到他说的一些话，非常有感慨。大多数普通人，只需要做好一件事就行了，那就是坚持，坚持一周没效果，就坚持一个月，一个月还没有，坚持一年，一年还没有，坚持十年。</p><p>当然了，前提条件是你在做一件有意义的事情。</p><p>也是，我是从 2014 年开始写作的，我没有写作天赋，我没有过硬的技术，没有太过耀眼的履历，学历也非常一般，绝大多数的球友都比我有优势。但我依然取得了很多很多程序员无法达到的成绩，为什么？</p><p>我想就是坚持吧。</p><p>仅 2020 年到 2022 年（五月份），我就在公众号上产出了 715 篇原创，这是什么概念，大家可以算一算。</p><p>为了保证自己学习的劲头，星球上周我产出了四条主题，不只是为了给球友们交付，也是为我自己交付。我是一个坚持主义者，我相信坚持的力量，只要大家敢在星球里持续打卡学习一周年，相信到时候你会来感激我的。</p><p>offer 拿到手软，自己的知识库也丰富起来了，逻辑很简单，就看行动了。</p><p>咦，上周的积分榜竟然消失了（以后要周日写总结），就还按照月榜来吧，恭喜前十名球友，你们都是最棒的。</p><p>第一名：沉默王二，上周排名低一，太强了我们星主。</p><p>第二名：南风知我意，上周排名第二，强</p><p>第三名：大三飞鸟，上周排名第三</p><p>第四名：小豪，上周排名第四</p><p>第五名：独孤孤独，上周排名第五</p><p>第六名：melo，上周排名第七（进步一名）</p><p>第七名：炳源，上周排名第六（掉了一名）</p><p>第八名： EE&amp;&amp;CS，上周排名第 10（冲上来了）</p><p>第九名： 疯狂地学习，上周排名第 8（下降一名）</p><p>第十名： 付雷彬，上周排名第 9（下降一名）</p><p>其他球友要加油了，毕竟这周要送价值 179 元的 on Java 8 实体书（上下两册，超级精美）。</p><p>不仅能学习，还能赚回球票，简直不要太爽！</p><h3 id="第四周打卡总结" tabindex="-1"><a class="header-anchor" href="#第四周打卡总结"><span>第四周打卡总结</span></a></h3><p>这周一共完成 2 节《编程喵🐱实战项目笔记》：</p><ul><li>第14节：Spring Boot 整合 MyBatis✔️地址：<a href="https://t.zsxq.com/02iMr3RvN" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02iMr3RvN</a></li><li>第15节：一键部署 Spring Boot 到远程 Docker 容器✔️地址：{https://t.zsxq.com/02QbUZneu](https://t.zsxq.com/02QbUZneu)</li></ul><p>个硬核分享：</p><ul><li>如何在逆境中走向希望：<a href="https://t.zsxq.com/02QZ76imE" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02QZ76imE</a></li><li>Navicat 破解版 Mac 版分享：<a href="https://t.zsxq.com/02eMf6AMZ" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02eMf6AMZ</a></li><li>能写到简历上的项目：<a href="https://t.zsxq.com/02JIQr3Rn" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02JIQr3Rn</a></li></ul><p>上一周总结：<a href="https://t.zsxq.com/02jiu3B23" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/02jiu3B23</a></p><p>这周主要有三件事，占据了非常多的时间。</p><p>第一个是剪视频，真的是废人啊。</p><p>第二个是写爬虫小程序，jsoup 真的是 yyds，配合正则表达式真的是无敌的存在。</p><p>第三个就是服务器被恶意攻击，这个真的是折磨人，叫了两个大厂的朋友一起处理，硬是没有找到最根本的问题。</p><p>公众号文章发出来后，发现绝大多数的小伙伴都受过这样的困扰。真的是。。。。。</p><p>希望来星球的小伙伴，尽量把打卡和规划安排起来，不要不好意思，真的是坚持的力量是无穷的。你看，真个五月份，我自己的分享安排的非常满。</p><p>当你去主动沉淀内容并且做到坚持的话，你会感觉自己的知识库是沉甸甸的，而不再是过了一个月发现，自己好像这个月没干什么正事。</p><p>明天就开始规划下一个月的学习计划了，在学校的小伙伴马上要放假了，可以把刷题笔记和星球的刷题冲刺搞起来了。尤其是报名的小伙伴，尽量一天刷个一道题吧。</p><p>最后是这周的排名。发现已经有几个小伙伴开始掉队了哈，该跟上的跟上，我周一会找你们一一聊一下。</p><p>加油，六月份！</p><p><em>没有什么使我停留——除了目的，纵然岸旁有玫瑰、有绿荫、有宁静的港湾，我是不系之舟</em>。</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/gongzhonghao.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>',100),n=[o];function l(i,s){return r(),t("div",null,n)}const m=e(a,[["render",l],["__file","may.html.vue"]]),g=JSON.parse('{"path":"/zhishixingqiu/may.html","title":"五月总结-沉默王二-二哥的Java进阶之路-知识星球","lang":"zh-CN","frontmatter":{"title":"五月总结-沉默王二-二哥的Java进阶之路-知识星球","shortTitle":"知识星球五月总结","category":["知识星球"],"tag":["知识星球"],"description":"沉默王二的编程知识星球-二哥的Java进阶之路-五月总结，这是一个 Java 学习指南 + 编程实战的私密圈子，你可以向二哥提问、帮你制定学习计划、跟着二哥一起做实战项目，冲冲冲。","head":[["meta",{"name":"keywords","content":"知识星球,沉默王二,二哥的Java进阶之路,编程,Java,IT,计算机专业"}],["meta",{"property":"og:url","content":"https://javabetter.cn/zhishixingqiu/may.html"}],["meta",{"property":"og:site_name","content":"二哥的Java进阶之路"}],["meta",{"property":"og:title","content":"五月总结-沉默王二-二哥的Java进阶之路-知识星球"}],["meta",{"property":"og:description","content":"沉默王二的编程知识星球-二哥的Java进阶之路-五月总结，这是一个 Java 学习指南 + 编程实战的私密圈子，你可以向二哥提问、帮你制定学习计划、跟着二哥一起做实战项目，冲冲冲。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:image","content":"https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/gongzhonghao.png"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2024-07-25T09:46:09.000Z"}],["meta",{"property":"article:author","content":"沉默王二"}],["meta",{"property":"article:tag","content":"知识星球"}],["meta",{"property":"article:modified_time","content":"2024-07-25T09:46:09.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"五月总结-沉默王二-二哥的Java进阶之路-知识星球\\",\\"image\\":[\\"https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/gongzhonghao.png\\"],\\"dateModified\\":\\"2024-07-25T09:46:09.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"沉默王二\\",\\"url\\":\\"/about-the-author/\\"}]}"]]},"headers":[{"level":3,"title":"第一周打卡总结","slug":"第一周打卡总结","link":"#第一周打卡总结","children":[]},{"level":3,"title":"第二周打卡总结","slug":"第二周打卡总结","link":"#第二周打卡总结","children":[]},{"level":3,"title":"第三周打卡总结","slug":"第三周打卡总结","link":"#第三周打卡总结","children":[]},{"level":3,"title":"第四周打卡总结","slug":"第四周打卡总结","link":"#第四周打卡总结","children":[]}],"git":{"createdTime":1655681394000,"updatedTime":1721900769000,"contributors":[{"name":"沉默王二","email":"www.qing_gee@163.com","commits":1}]},"readingTime":{"minutes":9.74,"words":2921},"filePathRelative":"zhishixingqiu/may.md","localizedDate":"2022年6月20日","excerpt":"<h3>第一周打卡总结</h3>\\n<p>当时要求的是任务是：</p>\\n<ul>\\n<li>回顾Java：什么是对象</li>\\n<li>搭建第一个 Spring Boot 项目</li>\\n<li>运行编程喵开源实战项目</li>\\n<li>完成星球专栏《面试官喜欢什么样的项目》主题编写</li>\\n</ul>\\n<p>完成情况：</p>\\n<ul>\\n<li>回顾Java：什么是对象✔️，笔记地址：<a href=\\"https://blog.csdn.net/buzai_chenmo/article/details/124522731\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">https://blog.csdn.net/buzai_chenmo/article/details/124522731</a></li>\\n<li>搭建第一个 Spring Boot 项目✔️地址：<a href=\\"https://t.zsxq.com/02rJeiYRj\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">https://t.zsxq.com/02rJeiYRj</a></li>\\n<li>运行编程喵开源实战项目✔️，笔记地址：<a href=\\"https://blog.csdn.net/buzai_chenmo/article/details/124536275\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">https://blog.csdn.net/buzai_chenmo/article/details/124536275</a></li>\\n<li>编程喵整合 MySQL+Druid✔️笔记地址：<a href=\\"https://t.zsxq.com/02IyrZFiq\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">https://t.zsxq.com/02IyrZFiq</a></li>\\n<li>编程喵整合 JPA✔️笔记地址：<a href=\\"https://t.zsxq.com/02Mfqr7UB\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">https://t.zsxq.com/02Mfqr7UB</a></li>\\n<li>《Java 面试指南》面试官喜欢什么样的求职者✔️笔记地址：<a href=\\"https://t.zsxq.com/6iuzn6I\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">https://t.zsxq.com/6iuzn6I</a></li>\\n</ul>"}');export{m as comp,g as data};
